import React from "react";
import styled from "styled-components";
import landing from "../illustration.jpg";

const Main = styled.div`
  display: flex;
  flex-direction: row;
  width: 100%;
  height: 100%;
  align-items: center;
  margin: 0;
  padding: 0;
`;

const LeftContainer = styled.div`
  background: white;
  height: 100%;
  width: 50%;
  display: flex;
  direction: column;
  align-items: center;
  justify-content: center;
`;

const RightContainer = styled.div`
  height: 100%;
  width: 50%;
  background: url(${landing});
  background-position: 0px -50px;
  background-size: cover;
`;

const LoginText = styled.h1`
  font-weight: 900;
  font-size: 35px;
  color: black;
`;

const BackgroundFilter = styled.div`
  height: 100%;
  width: 100%;
  background-color: rgba(38, 70, 83, 0.7);
  display: flex;
`;

function SignupPage() {
  return (
    <Main>
      <LeftContainer>
        <LoginText>Login</LoginText>
      </LeftContainer>
      <RightContainer />
    </Main>
  );
}

export default SignupPage;
